function [s,dsdF,D]=computeStress(...
  EvaluateStress,EvaluateLinearization,Transform,Parameters,X,F,Sizes)
% Compute stress

% Get general parameters
E=Parameters.YoungsModulus;
nu=Parameters.PoissonsRatio;
nsd=Sizes.NumSpaceDim;
msd=nsd*(nsd+1)/2;
ng=size(F,1);

% Evaluate elastic costants
if isa(E,'function_handle')
  E=E(X(:,1),X(:,2),X(:,3));
end
if isa(nu,'function_handle')
  nu=nu(X(:,1),X(:,2),X(:,3));
end

% Compute Lam√© parameters
mu=E./(2*(1+nu));
lambda=(nu.*E)./((1+nu).*(1-2*nu));
if nsd==2 && strcmp(Parameters.Assumption,'PlaneStress')
  lambda=(2*lambda.*mu)./(lambda+2*mu);
end

if strcmp(Parameters.DiscretizationType,'CG')
  % Initialization
  s=zeros(ng,nsd^2);
  dsdF=zeros(ng,nsd^4);
  D=NaN;
  
  % Extract deformation gradient
  if nsd==2
    Fxx=F(:,1); Fxy=F(:,2);
    Fyx=F(:,3); Fyy=F(:,4);
  elseif nsd==3
    Fxx=F(:,1); Fxy=F(:,2); Fxz=F(:,3);
    Fyx=F(:,4); Fyy=F(:,5); Fyz=F(:,6);
    Fzx=F(:,7); Fzy=F(:,8); Fzz=F(:,9);
  end
elseif strcmp(Parameters.DiscretizationType,'HDG')
  % Initialization
  s=NaN;
  dsdF=NaN;
  D=zeros(msd,msd);
end

% Include thermal effects
if matchField(Parameters,'Temperature')
  if strcmp(Parameters.DiscretizationType,'CG')
    if strcmp(Parameters.Model,'LinearElasticity')
      alpha=Parameters.CoefficientThermalExpansion;
      T0=Parameters.ReferenceTemperature;
      T=Parameters.Temperature(X(:,1),X(:,2),X(:,3));
      Fxx=Fxx-alpha*(T-T0);
      Fyy=Fyy-alpha*(T-T0);
      if nsd==3
        Fzz=Fzz-alpha*(T-T0);
      end
    else
      error('Thermal effects implemented only for LinearElasticity!')
    end
  else
    error('Thermal effects not implemented for HDG!')
  end
end

% Compute common terms
if strcmp(Parameters.DiscretizationType,'CG')
  if nsd==2
    J=Fxx.*Fyy-Fxy.*Fyx;
  elseif nsd==3
    J=Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx;
  end
  if strcmp(Parameters.Model,'LinearElasticity')
    if nsd==2
      trEps=Fxx+Fyy-2;
    elseif nsd==3
      trEps=Fxx+Fyy+Fzz-3;
    end
  elseif strcmp(Parameters.Model,'StVenantKirchhoff')
    if nsd==2
      trE=(Fxx.^2+Fxy.^2+Fyx.^2+Fyy.^2-2)/2;
    elseif nsd==3
      trE=(Fxx.^2+Fxy.^2+Fxz.^2+Fyx.^2+Fyy.^2+Fyz.^2+Fzx.^2+Fzy.^2+Fzz.^2-3)/2;
    end
  elseif strcmp(Parameters.Model,'NeoHook')
    logJ=log(J);
  end
end

% Evaluate stress tensor
if strcmp(EvaluateStress,'yes')
  if strcmp(Parameters.DiscretizationType,'CG')
    if strcmp(Transform,'no')
      if strcmp(Parameters.Model,'LinearElasticity')
        if nsd==2
          s(:,1)=lambda.*trEps+2.*mu.*(Fxx-1);
          s(:,2)=mu.*(Fxy+Fyx);
          s(:,3)=s(:,2);
          s(:,4)=lambda.*trEps+2.*mu.*(Fyy-1);
        elseif nsd==3
          s(:,1)=lambda.*trEps+2.*mu.*(Fxx-1);
          s(:,2)=mu.*(Fxy+Fyx);
          s(:,3)=mu.*(Fxz+Fzx);
          s(:,4)=s(:,2);
          s(:,5)=lambda.*trEps+2.*mu.*(Fyy-1);
          s(:,6)=mu.*(Fyz+Fzy);
          s(:,7)=s(:,3);
          s(:,8)=s(:,6);
          s(:,9)=lambda.*trEps+2.*mu.*(Fzz-1);
        end
      elseif strcmp(Parameters.Model,'StVenantKirchhoff')
        if nsd==2
          s(:,1)=mu.*(Fxx.*(Fxx.^2+Fyx.^2-1)+Fxy.*(Fxx.*Fxy+Fyx.*Fyy))+Fxx.*lambda.*trE;
          s(:,2)=mu.*(Fxy.*(Fxy.^2+Fyy.^2-1)+Fxx.*(Fxx.*Fxy+Fyx.*Fyy))+Fxy.*lambda.*trE;
          s(:,3)=mu.*(Fyx.*(Fxx.^2+Fyx.^2-1)+Fyy.*(Fxx.*Fxy+Fyx.*Fyy))+Fyx.*lambda.*trE;
          s(:,4)=mu.*(Fyy.*(Fxy.^2+Fyy.^2-1)+Fyx.*(Fxx.*Fxy+Fyx.*Fyy))+Fyy.*lambda.*trE;
        elseif nsd==3
          s(:,1)=Fxy.*mu.*(Fxx.*Fxy+Fyx.*Fyy+Fzx.*Fzy)+Fxz.*mu.*(Fxx.*Fxz+Fyx.*Fyz+Fzx.*Fzz)+Fxx.*mu.*(Fxx.^2+Fyx.^2+Fzx.^2-1)+Fxx.*lambda.*trE;
          s(:,2)=Fxx.*mu.*(Fxx.*Fxy+Fyx.*Fyy+Fzx.*Fzy)+Fxz.*mu.*(Fxy.*Fxz+Fyy.*Fyz+Fzy.*Fzz)+Fxy.*mu.*(Fxy.^2+Fyy.^2+Fzy.^2-1)+Fxy.*lambda.*trE;
          s(:,3)=Fxx.*mu.*(Fxx.*Fxz+Fyx.*Fyz+Fzx.*Fzz)+Fxy.*mu.*(Fxy.*Fxz+Fyy.*Fyz+Fzy.*Fzz)+Fxz.*mu.*(Fxz.^2+Fyz.^2+Fzz.^2-1)+Fxz.*lambda.*trE;
          s(:,4)=Fyy.*mu.*(Fxx.*Fxy+Fyx.*Fyy+Fzx.*Fzy)+Fyz.*mu.*(Fxx.*Fxz+Fyx.*Fyz+Fzx.*Fzz)+Fyx.*mu.*(Fxx.^2+Fyx.^2+Fzx.^2-1)+Fyx.*lambda.*trE;
          s(:,5)=Fyx.*mu.*(Fxx.*Fxy+Fyx.*Fyy+Fzx.*Fzy)+Fyz.*mu.*(Fxy.*Fxz+Fyy.*Fyz+Fzy.*Fzz)+Fyy.*mu.*(Fxy.^2+Fyy.^2+Fzy.^2-1)+Fyy.*lambda.*trE;
          s(:,6)=Fyx.*mu.*(Fxx.*Fxz+Fyx.*Fyz+Fzx.*Fzz)+Fyy.*mu.*(Fxy.*Fxz+Fyy.*Fyz+Fzy.*Fzz)+Fyz.*mu.*(Fxz.^2+Fyz.^2+Fzz.^2-1)+Fyz.*lambda.*trE;
          s(:,7)=Fzy.*mu.*(Fxx.*Fxy+Fyx.*Fyy+Fzx.*Fzy)+Fzz.*mu.*(Fxx.*Fxz+Fyx.*Fyz+Fzx.*Fzz)+Fzx.*mu.*(Fxx.^2+Fyx.^2+Fzx.^2-1)+Fzx.*lambda.*trE;
          s(:,8)=Fzx.*mu.*(Fxx.*Fxy+Fyx.*Fyy+Fzx.*Fzy)+Fzz.*mu.*(Fxy.*Fxz+Fyy.*Fyz+Fzy.*Fzz)+Fzy.*mu.*(Fxy.^2+Fyy.^2+Fzy.^2-1)+Fzy.*lambda.*trE;
          s(:,9)=Fzx.*mu.*(Fxx.*Fxz+Fyx.*Fyz+Fzx.*Fzz)+Fzy.*mu.*(Fxy.*Fxz+Fyy.*Fyz+Fzy.*Fzz)+Fzz.*mu.*(Fxz.^2+Fyz.^2+Fzz.^2-1)+Fzz.*lambda.*trE;
        end
      elseif strcmp(Parameters.Model,'NeoHook')
        if nsd==2
          s(:,1)=Fxx.*mu-(Fyy.*(mu-lambda.*logJ))./J;
          s(:,2)=Fxy.*mu+(Fyx.*(mu-lambda.*logJ))./J;
          s(:,3)=Fyx.*mu+(Fxy.*(mu-lambda.*logJ))./J;
          s(:,4)=Fyy.*mu-(Fxx.*(mu-lambda.*logJ))./J;
        elseif nsd==3
          s(:,1)=Fxx.*mu-((mu-lambda.*logJ).*(Fyy.*Fzz-Fyz.*Fzy))./J;
          s(:,2)=Fxy.*mu+((mu-lambda.*logJ).*(Fyx.*Fzz-Fyz.*Fzx))./J;
          s(:,3)=Fxz.*mu-((mu-lambda.*logJ).*(Fyx.*Fzy-Fyy.*Fzx))./J;
          s(:,4)=Fyx.*mu+((mu-lambda.*logJ).*(Fxy.*Fzz-Fxz.*Fzy))./J;
          s(:,5)=Fyy.*mu-((mu-lambda.*logJ).*(Fxx.*Fzz-Fxz.*Fzx))./J;
          s(:,6)=Fyz.*mu+((mu-lambda.*logJ).*(Fxx.*Fzy-Fxy.*Fzx))./J;
          s(:,7)=Fzx.*mu-((mu-lambda.*logJ).*(Fxy.*Fyz-Fxz.*Fyy))./J;
          s(:,8)=Fzy.*mu+((mu-lambda.*logJ).*(Fxx.*Fyz-Fxz.*Fyx))./J;
          s(:,9)=Fzz.*mu-((mu-lambda.*logJ).*(Fxx.*Fyy-Fxy.*Fyx))./J;
        end
      end
    elseif strcmp(Transform,'push-forward')
      if strcmp(Parameters.Model,'LinearElasticity')
        if nsd==2
          s(:,1)=(mu.*(2.*Fxx.^2-2.*Fxx+Fxy.^2+Fyx.*Fxy))./J+(Fxx.*lambda.*trEps)./J;
          s(:,2)=mu.*((Fyx.*(2.*Fxx-2))./J+(2.*Fyy.*(Fxy./2+Fyx./2))./J)+(Fyx.*lambda.*trEps)./J;
          s(:,3)=mu.*((Fxy.*(2.*Fyy-2))./J+(2.*Fxx.*(Fxy./2+Fyx./2))./J)+(Fxy.*lambda.*trEps)./J;
          s(:,4)=(mu.*(Fyx.^2-2.*Fyy+2.*Fyy.^2+Fxy.*Fyx))./J+(Fyy.*lambda.*trEps)./J;
        elseif nsd==3
          s(:,1)=(mu.*(2.*Fxx.^2-2.*Fxx+Fxy.^2+Fyx.*Fxy+Fxz.^2+Fzx.*Fxz))./J+(Fxx.*lambda.*trEps)./J;
          s(:,2)=mu.*((Fyx.*(2.*Fxx-2))./J+(2.*Fyy.*(Fxy./2+Fyx./2))./J+(2.*Fyz.*(Fxz./2+Fzx./2))./J)+(Fyx.*lambda.*trEps)./J;
          s(:,3)=mu.*((Fzx.*(2.*Fxx-2))./J+(2.*Fzy.*(Fxy./2+Fyx./2))./J+(2.*Fzz.*(Fxz./2+Fzx./2))./J)+(Fzx.*lambda.*trEps)./J;
          s(:,4)=mu.*((Fxy.*(2.*Fyy-2))./J+(2.*Fxx.*(Fxy./2+Fyx./2))./J+(2.*Fxz.*(Fyz./2+Fzy./2))./J)+(Fxy.*lambda.*trEps)./J;
          s(:,5)=(mu.*(Fyx.^2-2.*Fyy+2.*Fyy.^2+Fyz.^2+Fxy.*Fyx+Fyz.*Fzy))./J+(Fyy.*lambda.*trEps)./J;
          s(:,6)=mu.*((Fzy.*(2.*Fyy-2))./J+(2.*Fzx.*(Fxy./2+Fyx./2))./J+(2.*Fzz.*(Fyz./2+Fzy./2))./J)+(Fzy.*lambda.*trEps)./J;
          s(:,7)=mu.*((Fxz.*(2.*Fzz-2))./J+(2.*Fxx.*(Fxz./2+Fzx./2))./J+(2.*Fxy.*(Fyz./2+Fzy./2))./J)+(Fxz.*lambda.*trEps)./J;
          s(:,8)=mu.*((Fyz.*(2.*Fzz-2))./J+(2.*Fyx.*(Fxz./2+Fzx./2))./J+(2.*Fyy.*(Fyz./2+Fzy./2))./J)+(Fyz.*lambda.*trEps)./J;
          s(:,9)=(mu.*(Fzx.^2-2.*Fzz+Fzy.^2+2.*Fzz.^2+Fxz.*Fzx+Fyz.*Fzy))./J+(Fzz.*lambda.*trEps)./J;
        end
      elseif strcmp(Parameters.Model,'StVenantKirchhoff')
        if nsd==2
          s(:,1)=(mu.*(Fxx.^4-Fxx.^2-Fxy.^2+Fxy.^4+2.*Fxx.^2.*Fxy.^2+Fxx.^2.*Fyx.^2+Fxy.^2.*Fyy.^2+2.*Fxx.*Fxy.*Fyx.*Fyy))./J+(lambda.*trE.*(Fxx.^2+Fxy.^2))./J;
          s(:,2)=(lambda.*trE.*(Fxx.*Fyx+Fxy.*Fyy))./J+(mu.*(Fxx.*Fyx+Fxy.*Fyy).*(Fxx.^2+Fxy.^2+Fyx.^2+Fyy.^2-1))./J;
          s(:,3)=(lambda.*trE.*(Fxx.*Fyx+Fxy.*Fyy))./J+(mu.*(Fxx.*Fyx+Fxy.*Fyy).*(Fxx.^2+Fxy.^2+Fyx.^2+Fyy.^2-1))./J;
          s(:,4)=(mu.*(Fyx.^4-Fyx.^2-Fyy.^2+Fyy.^4+Fxx.^2.*Fyx.^2+Fxy.^2.*Fyy.^2+2.*Fyx.^2.*Fyy.^2+2.*Fxx.*Fxy.*Fyx.*Fyy))./J+(lambda.*trE.*(Fyx.^2+Fyy.^2))./J;
        elseif nsd==3
          s(:,1)=(mu.*(Fxx.^4+2.*Fxx.^2.*Fxy.^2+2.*Fxx.^2.*Fxz.^2+Fxx.^2.*Fyx.^2+Fxx.^2.*Fzx.^2-Fxx.^2+2.*Fxx.*Fxy.*Fyx.*Fyy+2.*Fxx.*Fxy.*Fzx.*Fzy+2.*Fxx.*Fxz.*Fyx.*Fyz+2.*Fxx.*Fxz.*Fzx.*Fzz+Fxy.^4+2.*Fxy.^2.*Fxz.^2+Fxy.^2.*Fyy.^2+Fxy.^2.*Fzy.^2-Fxy.^2+2.*Fxy.*Fxz.*Fyy.*Fyz+2.*Fxy.*Fxz.*Fzy.*Fzz+Fxz.^4+Fxz.^2.*Fyz.^2+Fxz.^2.*Fzz.^2-Fxz.^2))./J+(lambda.*trE.*(Fxx.^2+Fxy.^2+Fxz.^2))./J;
          s(:,2)=mu.*((Fyx.*(2.*Fxx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fxy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fxz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)))./J+(Fyy.*(2.*Fxy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fxz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J+(Fyz.*(2.*Fxz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fxy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J)+(lambda.*trE.*(Fxx.*Fyx+Fxy.*Fyy+Fxz.*Fyz))./J;
          s(:,3)=mu.*((Fzx.*(2.*Fxx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fxy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fxz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)))./J+(Fzy.*(2.*Fxy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fxz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J+(Fzz.*(2.*Fxz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fxy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J)+(lambda.*trE.*(Fxx.*Fzx+Fxy.*Fzy+Fxz.*Fzz))./J;
          s(:,4)=mu.*((Fxx.*(2.*Fyx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fyy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fyz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)))./J+(Fxy.*(2.*Fyy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fyz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J+(Fxz.*(2.*Fyz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fyy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J)+(lambda.*trE.*(Fxx.*Fyx+Fxy.*Fyy+Fxz.*Fyz))./J;
          s(:,5)=(mu.*(Fyx.^4-Fyx.^2-Fyy.^2+Fyy.^4-Fyz.^2+Fyz.^4+Fxx.^2.*Fyx.^2+Fxy.^2.*Fyy.^2+Fxz.^2.*Fyz.^2+2.*Fyx.^2.*Fyy.^2+2.*Fyx.^2.*Fyz.^2+2.*Fyy.^2.*Fyz.^2+Fyx.^2.*Fzx.^2+Fyy.^2.*Fzy.^2+Fyz.^2.*Fzz.^2+2.*Fxx.*Fxy.*Fyx.*Fyy+2.*Fxx.*Fxz.*Fyx.*Fyz+2.*Fxy.*Fxz.*Fyy.*Fyz+2.*Fyx.*Fyy.*Fzx.*Fzy+2.*Fyx.*Fyz.*Fzx.*Fzz+2.*Fyy.*Fyz.*Fzy.*Fzz))./J+(lambda.*trE.*(Fyx.^2+Fyy.^2+Fyz.^2))./J;
          s(:,6)=mu.*((Fzx.*(2.*Fyx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fyy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fyz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)))./J+(Fzy.*(2.*Fyy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fyz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J+(Fzz.*(2.*Fyz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fyy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J)+(lambda.*trE.*(Fyx.*Fzx+Fyy.*Fzy+Fyz.*Fzz))./J;
          s(:,7)=mu.*((Fxx.*(2.*Fzx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fzy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fzz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)))./J+(Fxy.*(2.*Fzy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fzx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fzz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J+(Fxz.*(2.*Fzz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fzx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fzy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J)+(lambda.*trE.*(Fxx.*Fzx+Fxy.*Fzy+Fxz.*Fzz))./J;
          s(:,8)=mu.*((Fyx.*(2.*Fzx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fzy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fzz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)))./J+(Fyy.*(2.*Fzy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fzx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fzz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J+(Fyz.*(2.*Fzz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fzx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fzy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2)))./J)+(lambda.*trE.*(Fyx.*Fzx+Fyy.*Fzy+Fyz.*Fzz))./J;
          s(:,9)=(mu.*(Fzx.^4-Fzx.^2-Fzy.^2+Fzy.^4-Fzz.^2+Fzz.^4+Fxx.^2.*Fzx.^2+Fxy.^2.*Fzy.^2+Fxz.^2.*Fzz.^2+Fyx.^2.*Fzx.^2+Fyy.^2.*Fzy.^2+Fyz.^2.*Fzz.^2+2.*Fzx.^2.*Fzy.^2+2.*Fzx.^2.*Fzz.^2+2.*Fzy.^2.*Fzz.^2+2.*Fxx.*Fxy.*Fzx.*Fzy+2.*Fxx.*Fxz.*Fzx.*Fzz+2.*Fxy.*Fxz.*Fzy.*Fzz+2.*Fyx.*Fyy.*Fzx.*Fzy+2.*Fyx.*Fyz.*Fzx.*Fzz+2.*Fyy.*Fyz.*Fzy.*Fzz))./J+(lambda.*trE.*(Fzx.^2+Fzy.^2+Fzz.^2))./J;
        end
      elseif strcmp(Parameters.Model,'NeoHook')
        if nsd==2
          s(:,1)=(mu.*(Fxx.^2+Fxy.^2-1))./J+(lambda.*logJ)./J;
          s(:,2)=(mu.*(Fxx.*Fyx+Fxy.*Fyy))./J;
          s(:,3)=(mu.*(Fxx.*Fyx+Fxy.*Fyy))./J;
          s(:,4)=(mu.*(Fyx.^2+Fyy.^2-1))./J+(lambda.*logJ)./J;
        elseif nsd==3
          s(:,1)=(mu.*(Fxx.^2+Fxy.^2+Fxz.^2-1))./J+(lambda.*logJ)./J;
          s(:,2)=(mu.*(Fxx.*Fyx+Fxy.*Fyy+Fxz.*Fyz))./J;
          s(:,3)=(mu.*(Fxx.*Fzx+Fxy.*Fzy+Fxz.*Fzz))./J;
          s(:,4)=(mu.*(Fxx.*Fyx+Fxy.*Fyy+Fxz.*Fyz))./J;
          s(:,5)=(mu.*(Fyx.^2+Fyy.^2+Fyz.^2-1))./J+(lambda.*logJ)./J;
          s(:,6)=(mu.*(Fyx.*Fzx+Fyy.*Fzy+Fyz.*Fzz))./J;
          s(:,7)=(mu.*(Fxx.*Fzx+Fxy.*Fzy+Fxz.*Fzz))./J;
          s(:,8)=(mu.*(Fyx.*Fzx+Fyy.*Fzy+Fyz.*Fzz))./J;
          s(:,9)=(mu.*(Fzx.^2+Fzy.^2+Fzz.^2-1))./J+(lambda.*logJ)./J;
        end
      end
    elseif strcmp(Transform,'pull-back')
      if strcmp(Parameters.Model,'LinearElasticity')
        if nsd==2
          s(:,1)=+mu.*(2.*Fyy.*(Fxx-1)-Fxy.*(Fxy+Fyx))+Fyy.*lambda.*trEps;
          s(:,2)=-mu.*(2.*Fyx.*(Fxx-1)-Fxx.*(Fxy+Fyx))-Fyx.*lambda.*trEps;
          s(:,3)=-mu.*(2.*Fxy.*(Fyy-1)-Fyy.*(Fxy+Fyx))-Fxy.*lambda.*trEps;
          s(:,4)=+mu.*(2.*Fxx.*(Fyy-1)-Fyx.*(Fxy+Fyx))+Fxx.*lambda.*trEps;
        elseif nsd==3
          s(:,1)=+mu.*(2.*(Fxy.*Fyz-Fxz.*Fyy).*(Fxz./2+Fzx./2)-(Fxy.*Fzz-Fxz.*Fzy).*(Fxy+Fyx)+(2.*Fxx-2).*(Fyy.*Fzz-Fyz.*Fzy))+lambda.*trEps.*(Fyy.*Fzz-Fyz.*Fzy);
